import React from "react";
import Navbar from "../components/Navbar";

const Home = () => {
    return (
        <div>
            <Navbar />
            <h1>Welcome to the Home Page</h1>
            <p>This page is accessible to everyone.</p>
        </div>
    );
};

export default Home;
